package com.trendcore.problems.leetcode;

import java.util.HashMap;
import java.util.Map;

/**
 * https://leetcode.com/problems/valid-anagram/
 * <p>
 * Given two strings s and t , write a function to determine if t is an anagram of s.
 * <p>
 * Example 1:
 * <p>
 * Input: s = "anagram", t = "nagaram"
 * Output: true
 * Example 2:
 * <p>
 * Input: s = "rat", t = "car"
 * Output: false
 */
public class ValidAnagram {

    public static void main(String[] args) {
        ValidAnagram v = new ValidAnagram();
        v.testCase("ate", "eat");
        v.testCase("ate", "tan");
        v.testCase("tat", "ta");
        v.testCase("aacc", "ccac");

        v.testCase("",
                ""        );



    }

    private void testCase(String s, String t) {
        System.out.println(isAnagram(s, t));
    }

    public boolean isAnagram(String s, String t) {

        return approach1(s, t);
    }

    //TODO : Optimize me using hash table.
    private boolean approach1(String s, String t) {
        if (s.length() != t.length()) {
            return false;
        }

        //one easy way
        Map<Character, Integer> charMap1 = new HashMap();
        Map charMap2 = new HashMap();
        for (int i = 0; i < s.length(); i++) {
            Object c1 = charMap1.get(s.charAt(i));
            if (c1 != null) {
                Integer k = (Integer) c1;
                charMap1.put(s.charAt(i), k + 1);
            } else {
                charMap1.put(s.charAt(i), 1);
            }

            Object c2 = charMap2.get(t.charAt(i));
            if (c2 != null) {
                Integer k = (Integer) c2;
                charMap2.put(t.charAt(i), k + 1);
            } else {
                charMap2.put(t.charAt(i), 1);
            }
        }

        for (Map.Entry<Character, Integer> e : charMap1.entrySet()) {
            Character key = e.getKey();
            Object o = charMap2.get(key);
            if (o != null) {
                if (!o.equals(e.getValue())) {
                    return false;
                }
            } else {
                return false;
            }
        }

        return true;
    }

}
